const currTime = new Date().toLocaleTimeString();
// new yar

ReactDOM.render(

  <div className='heading'>
    <h1> Hello sir,{fName} </h1>
    <p>Current Date :{currDate}</p>
    <p>Current Time :{currTime}</p>
  </div>, 

  document.getElementById('root')
);
